import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import "./Home.css";
import stImg from "./st.jpg"

export default class Home extends Component {
  render() {
    return (
        <Container className="homeContainer" fluid>
          <Row>
            <Col><img className="imgHome" src={stImg} alt="Süleyman TAŞÇI"></img></Col>
            <Col>
            <p>Webmaster</p>
            <h3>Süleyman TAŞÇI</h3>
            <p>1995 yılının Temmuz ayında Malatya ilinin Arapgir ilçesinde doğdum. 1999 marmara depreminden  sonra henüz dört yaşımda iken ailemle birlikte istanbula yerleştik. İlköğretim eğitimimi 75. yıl İlköğretim Okulu’nda tamamladım. İstanbul'un eski liselerinden biri sayılan Osman Ülkümen Anadolu lisesinde eğitimime devam ettim. Lise yıllarımda almış olduğum eğitim ve öğretimin, kazandığım sosyal ve teknolojik becerilerin, edindiğim hayat tecrübesinin ilerlememde büyük rol oynadığını söyleyebilirim. 2014 yılında Nişantaşı Üniversitesi İnşaat Mühendisliği Bölümü’nü kazandım. 2018 haziran ayında lisans eğitimimi tamamlayarak mezun oldum.</p>
            <button>Özgemiş İndir</button>
            </Col>
          </Row>
          <h4>Ne Yaparım</h4>
          <Row>
            <Col><h4>Hakediş Mühendisi</h4>
            <p>Alt yükleniciden gelen hakedişlerin kontrolü, imalat metraj çıkarımı, hakediş rapor ve ataşmanların düzenlenmesi, işverene hakediş hazırlanması.</p>
            <h4>Hakediş Mühendisi</h4>
            <p>Alt yükleniciden gelen hakedişlerin kontrolü, imalat metraj çıkarımı, hakediş rapor ve ataşmanların düzenlenmesi, işverene hakediş hazırlanması.</p></Col>
            <Col><h4>Hakediş Mühendisi</h4>
            <p>Alt yükleniciden gelen hakedişlerin kontrolü, imalat metraj çıkarımı, hakediş rapor ve ataşmanların düzenlenmesi, işverene hakediş hazırlanması.</p>
            <h4>Hakediş Mühendisi</h4>
            <p>Alt yükleniciden gelen hakedişlerin kontrolü, imalat metraj çıkarımı, hakediş rapor ve ataşmanların düzenlenmesi, işverene hakediş hazırlanması.</p></Col>
          </Row>
        </Container>
    );
  }
}
